import craft from "./images/craft.jpg"

const productsData = [
    {
        image: {craft},
        title: "first title",
        description: "first description",
        id: 1
    },
    {
        image: {craft},
        title: "second title",
        description: "second description",
        id: 2
    },
    {
        image: {craft},
        title: "third title",
        description: "third description",
        id: 3
    },
    {
        image: {craft},
        title: "fourth title",
        description: "fourth description",
        id: 4
    },
    {
        image: {craft},
        title: "fifth title",
        description: "fifth description",
        id: 5
    },
    {
        image: {craft},
        title: "sixth title",
        description: "sixth description",
        id: 6
    }
]

export { productsData }
